import React from 'react'
import image from '../images/cyanbb.png'
import Contact from '../components/Contact'
import contactsData from '../ContactData'
import { Link } from 'react-router-dom'



function ContactCard() {
    const contactDetails = contactsData.map(contacts => {
      return (
        <Contact
          id={contacts.id}
          {...contacts}
        />
      )
    })

    return (
      <div className='card-div'>
        {contactDetails}
      </div>
    );
  }

export default function Houses(){
    return (
        <div className='indexpage'>
            <img className='background-img' src={image} alt='background' />
            <div className='home-box'>
                <div className='houses-components'>
                    <Link to ='#' className='btn btn-white btn-animation-1'>Listings</Link>
                    <Link to ='#' className='btn btn-white btn-animation-1'>Postings</Link>
                </div>
                {/* <div className='houses-components'>
                    <NavLink to='/Houses' className='tab-btn' activeClassName='active-tab'>Listings</NavLink>
                    <NavLink to='/postings' className='tab-btn' activeClassName='active-tab'>Postings</NavLink>
                </div> */}
                <div class="tab">
                    <button class="tablinks" onclick="openCity(event, 'London')">London</button>
                    <button class="tablinks" onclick="openCity(event, 'Paris')">Paris</button>
                    <button class="tablinks" onclick="openCity(event, 'Tokyo')">Tokyo</button>
                </div>
                <div id="London" class="tabcontent">
                    <h3>London</h3>
                    <p>London is the capital city of England.</p>
                </div>

                <div id="Paris" class="tabcontent">
                    <h3>Paris</h3>
                    <p>Paris is the capital of France.</p>
                </div>

                <div id="Tokyo" class="tabcontent">
                    <h3>Tokyo</h3>
                    <p>Tokyo is the capital of Japan.</p>
                </div>
                <ContactCard />
            </div>
        </div>
    )
}
